import { ReactPropTypes } from "react";

const Auth = ({ setAuthData }) => {
  const handleLogin = () => {
    const data = {};
    setAuthData(data);
  };
  return <div onClick={() => handleLogin()}>Login</div>;
};

Auth.defaultProps = {
  setAuthData: () => {},
};

Auth.propTypes = {
  setAuthData: ReactPropTypes.func,
};

export default Auth;
